// CODE FOR PLOTTING STARS

const canvas = document.getElementById('starchart');
const ctx = canvas.getContext('2d');

// Parse CSV into an array of objects
function parseCSV(csvString) {
    const rows = csvString.trim().split("\n");
    const headers = rows[0].split(",");
    return rows.slice(1).map(row => {
        const values = row.split(",");
        // console.log(row);
        // console.log(values)
        let result = {};
        headers.forEach((header, index) => {
            result[header] = index <  2? values[index] : parseFloat(values[index]); // Convert numeric fields
        });
        // console.log(result);
        return result;
    });
}

// Fetch and process data
async function fetchData() {
    const dfStars = parseCSV(stars_data_cleaned2);
    const dfExoplanets = parseCSV(exoplanet_data_cleaned);

    // Ensure numeric conversion and clean data
    const numericColumns = ['galactic_longitude', 'galactic_latitude', 'visual_magnitude', 'distance'];
    dfStars.forEach(d => numericColumns.forEach(col => d[col] = +d[col]));
    const cleanedStars = dfStars.filter(d => numericColumns.every(col => !isNaN(d[col])));

    const exoplanet = dfExoplanets[selectedExo];  // Select the first exoplanet
    const lExoRad = degToRad(exoplanet['galactic_longitude']);
    const bExoRad = degToRad(exoplanet['galactic_latitude']);
    const dExoPc = +exoplanet['distance'];

    // Compute exoplanet position
    const xExo = dExoPc * Math.cos(bExoRad) * Math.cos(lExoRad);
    const yExo = dExoPc * Math.cos(bExoRad) * Math.sin(lExoRad);
    const zExo = dExoPc * Math.sin(bExoRad);

    // Add relative positions for stars
    cleanedStars.forEach(d => {
        const lRad = degToRad(d.galactic_longitude);
        const bRad = degToRad(d.galactic_latitude);
        const distancePc = d.distance;

        const xStar = distancePc * Math.cos(bRad) * Math.cos(lRad);
        const yStar = distancePc * Math.cos(bRad) * Math.sin(lRad);
        const zStar = distancePc * Math.sin(bRad);

        d.x_rel = xStar - xExo;
        d.y_rel = yStar - yExo;
        d.z_rel = zStar - zExo;
        d.d_new = Math.sqrt(d.x_rel ** 2 + d.y_rel ** 2 + d.z_rel ** 2);
    });

    // Filter out stars that are too close to the exoplanet
    const dfStarsFiltered = cleanedStars.filter(d => d.d_new > 0);

    dfStarsFiltered.forEach(d => {
        d.b_new_rad = Math.asin(d.z_rel / d.d_new);
        d.l_new_rad = Math.atan2(d.y_rel, d.x_rel) % (2 * Math.PI);
        d.galactic_longitude_new = radToDeg(d.l_new_rad);
        d.galactic_latitude_new = radToDeg(d.b_new_rad);

        d.M = d.visual_magnitude - 5 * (Math.log10(d.distance) - 1);
        d.visual_magnitude_new = d.M + 5 * (Math.log10(d.d_new) - 1);
    });

    const magnitudeLimit = 15;
    const dfVisibleStars = dfStarsFiltered.filter(d => d.visual_magnitude_new <= magnitudeLimit);

    if (dfVisibleStars.length > 0) {
        // Determine reference magnitude and brightness
        const mRef = Math.min(...dfVisibleStars.map(d => d.visual_magnitude_new));
        dfVisibleStars.forEach(d => {
            d.brightness = Math.pow(10, -0.4 * (d.visual_magnitude_new - mRef));
            d.size = d.brightness * 60;
            d.size = Math.max(.4, Math.min(d.size, 5));
        });

        // Plot stars on canvas
        drawStars(dfVisibleStars, exoplanet['pl_name']);
    } else {
        const label = document.getElementById('label');
        label.innerHTML = `Sky as Seen from Exoplanet ${exoplanet['pl_name']} - No Visible Stars`;
        console.log("No visible stars found with the current magnitude limit.");
    }
}

// Helper functions
function degToRad(deg) {
    return deg * (Math.PI / 180);
}

function radToDeg(rad) {
    return rad * (180 / Math.PI);
}

function drawStars(stars, exoplanetName) {
    // Canvas settings
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    ctx.fillStyle = 'black';
    ctx.fillRect(0, 0, canvas.width, canvas.height);

    ctx.fillStyle = 'white';
    stars.forEach(star => {
        const x = (mapRange(star.galactic_longitude_new, -180, 180, 0, canvas.width) + 600) % 1200;  // Inverted x-axis mapping
        const y = mapRange(star.galactic_latitude_new, -180, 180, 0, canvas.height * 2) - 300;
        
        ctx.beginPath();
        ctx.arc(x, y, star.size, 0, 2 * Math.PI, false);
        ctx.fill();
    });

    const label = document.getElementById('label');
    label.innerHTML = `Sky as Seen from Exoplanet ${exoplanetName}`;
}

// Map function to map data ranges to canvas coordinates
function mapRange(value, inMin, inMax, outMin, outMax) {
  return (value - inMin) * (outMax - outMin) / (inMax - inMin) + outMin;
}


